-- ----------------------------
--  Table structure for `cidade`
-- ----------------------------
DROP TABLE IF EXISTS `cidade`;
CREATE TABLE `cidade` (
  `cidd_codi` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `cidd_uf` char(2) NOT NULL,
  `cidd_nome` varchar(40) NOT NULL,
  `cidd_noac` varchar(40) NOT NULL,
  `cidd_capi` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `cidd_pais` varchar(3) DEFAULT NULL,
  PRIMARY KEY (`cidd_codi`),
  KEY `FK_uf_cidade` (`cidd_uf`),
  CONSTRAINT `FK_uf_cidade` FOREIGN KEY (`cidd_uf`) REFERENCES `uf` (`uf_codi`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1000062 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `cliente`
-- ----------------------------
DROP TABLE IF EXISTS `cliente`;
CREATE TABLE `cliente` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
